import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";
import "animate.css";

const LoginSignup = () => {
  return (
    <div className="d-flex flex-column justify-content-center align-items-center vh-100 bg-light">
      <div className="card p-5 shadow-lg animate__animated animate__fadeInDown" style={{ width: "22rem" }}>
        <h2 className="text-center mb-4 text-primary">Join VideoChat</h2>
        <form>
          <div className="mb-3">
            <input type="email" className="form-control" placeholder="Email address" required />
          </div>
          <div className="mb-3">
            <input type="password" className="form-control" placeholder="Password" required />
          </div>
          <div className="d-grid gap-2">
            <button type="submit" className="btn btn-primary">
              Login
            </button>
            <button type="button" className="btn btn-outline-primary">
              Signup
            </button>
          </div>
        </form>
        <div className="text-center mt-3">
          <a href="#" className="text-decoration-none">Forgot Password?</a> <br />
          <a href="#" className="text-decoration-none">New User? Signup</a>
        </div>
      </div>
    </div>
  );
};

export default LoginSignup;
